function getFullNum(num) {
    if (num > 9)
        return num.toString();
    else
        return '0' + num.toString();
}
function toastInfo(input) {
    toast(input);
    console.info(input);
}
function toastWarn(input) {
    toast(input);
    console.warn(input);
}
function toastError(input) {
    toast(input);
    console.error(input);
}
function setTimer() {
    rawInput('填报时间,姓名,身份证号,发送群名', getFullNum(runAt.getHours()) + ':' + getFullNum(runAt.getMinutes()) + ',' + userName + ',' + userId + ',' + userGroupName, input => {
        if (input === null)
            return;
        let params = input.split(',');
        if (params.length !== 4) {
            toastWarn('格式不正确，将使用默认值。');
        }
        else {
            let timeInput = params[0];
            if (new RegExp(/^(?:(?:[0-2][0-3])|(?:[0-1][0-9])):[0-5][0-9]$/).test(timeInput)) {
                runAt.setHours(timeInput.split(':')[0]);
                if (timeInput === '00:00')
                    runAt.setMinutes(parseInt(timeInput.split(':')[1]) + 1);
                else if (timeInput === new Date().toTimeString().substring(0, 5)) {
                    if (timeInput.substring(3, 5) === '59') {
                        if (timeInput === '23:59') {
                            runAt.setHours(0);
                            runAt.setMinutes(1);
                        }
                        else {
                            runAt.setHours(parseInt(timeInput.split(':')[0]) + 1);
                            runAt.setMinutes(0);
                        }
                    }
                    else
                        runAt.setMinutes(parseInt(timeInput.split(':')[1]) + 1);
                }
                else
                    runAt.setMinutes(timeInput.split(':')[1]);
            }
            else
                toastWarn('时间格式不正确，将使用默认值 07:00 或最后一次正确设置的值。');
            let nameInput = params[1];
            if (nameInput.trim().length >= 2) {
                userName = nameInput;
            }
            else
                toastWarn('姓名格式不正确，将使用默认值“拜登”或最后一次正确设置的值。');
            let idInput = params[2];
            if (new RegExp(/^[0-9*]{14}[0-9]{4}$/).test(idInput)) {
                userId = idInput;
            }
            else
                toastWarn('身份证号格式不正确，将使用默认值 110101194211207956 或最后一次正确设置的值。');
            let groupNameInput = params[3];
            if (groupNameInput.trim().length >= 1) {
                userGroupName = groupNameInput;
            }
            else
                toastWarn('发送群名格式不正确，将使用默认值“相亲相爱一家人”或最后一次正确设置的值。');
        }
        complete = false;
        storage.put('settings', { runAt: { hour: runAt.toTimeString().substring(0, 2), minute: runAt.toTimeString().substring(3, 5) }, userName: userName, userId: userId, userGroupName: userGroupName });
        toastInfo('设置填报时间为 ' + runAt.toTimeString().substring(0, 5) + '。');
    });
}
