ajpUnlock();
let storage = storages.create('life.his2nd.autofillin2');
let settings = storage.get('settings');
let runAt = new Date();
runAt.setHours(7);
runAt.setMinutes(0);
runAt.setSeconds(0);
let userName = '拜登';
let userId = '110101194211207956';
let userGroupName = '相亲相爱一家人';
if (typeof settings === 'undefined')
    storage.put('settings', { runAt: { hour: runAt.toTimeString().substring(0, 2), minute: runAt.toTimeString().substring(3, 5) }, userName: userName, userId: userId, userGroupName: userGroupName });
else {
    let h = parseInt(settings.runAt.hour);
    let m = parseInt(settings.runAt.minute);
    let now = new Date().toTimeString().substring(0, 5);
    let hNow = parseInt(now.split(':')[0]);
    let mNow = parseInt(now.split(':')[1]);
    if (h === hNow && m === mNow) {
        if (m === 59) {
            if (h === 23) {
                runAt.setHours(0);
                runAt.setMinutes(1);
            }
            else {
                runAt.setHours(h + 1);
                runAt.setMinutes(0);
            }
        }
        else {
            runAt.setHours(h);
            runAt.setMinutes(m + 1);
        }
    }
    else {
        runAt.setHours(h);
        runAt.setMinutes(m);
    }
    if (typeof settings.userName !== 'undefined') {
        userName = settings.userName;
    }
    if (typeof settings.userId !== 'undefined') {
        userId = settings.userId;
    }
    if (typeof settings.userGroupName !== 'undefined') {
        userGroupName = settings.userGroupName;
    }
}
let running = false;
let complete = false;
// #region 悬浮窗
let w = DEV ? floaty.rawWindow(
    <vertical gravity="center" alpha="0.5">
        <img id="icon" w="32" h="32" src="data:image/png;base64," />
    </vertical>
) : floaty.rawWindow(
    <vertical gravity="center" alpha="0.5">
        <img id="icon" w="32" h="32" src="data:image/png;base64," />
    </vertical>
);
// #endregion
w.setPosition(device.width - 128, device.height / 2);
w.setTouchable(true);
w.icon.click(function () { setTimer(); });
toastInfo('点击齿轮图标以设置填报参数，如不设置，将使用默认值或最后一次正确设置的值。');
setInterval(() => {
    let sta = context.resources.configuration.orientation;
    sta === 2 ? ui.run(() => { w.icon.visibility = 8 }) : ui.run(() => { w.icon.visibility = 0 });
    if (new Date().toTimeString().substring(0, 5) === '00:00')
        complete = false;
    //if (new Date().toTimeString().substring(0, 5) === runAt.toTimeString().substring(0, 5))
    if (new Date().toTimeString().substring(0, 5) === runAt.toTimeString().substring(0, 5) || DEV)
        fillIn();
}, 1000);
if (storage.get('scriptFirstRun') !== false) {
    toastLog('运行启动测试，如向您请求启动，务必允许。');
    launch('com.tencent.mm');
    waitForPackage('com.tencent.mm');
    app.startActivity('console');
    storage.put('scriptFirstRun', false);
}
toastLog('等待。');
function fillIn() {
    if (running || complete)
        return;
    running = true;
    toastInfo('时间到。');
    if (!device.isScreenOn()) {
        device.wakeUp();
        sleep(5000);
        swipe(device.width / 2, device.height - 300, device.width / 2, 300, 500);
        sleep(5000);
    }
    device.keepScreenDim(5 * 60 * 1000);
    toastInfo('开始生成密接自查图片，建议使用思源黑体作为系统默认字体。');
    // #region 空白行程卡图片 Base64
    let picBlank = images.fromBase64('data:image/jpeg;base64,');
    // #endregion
    let canvas = new Canvas(picBlank);
    let paintName = new Paint();
    paintName.setAntiAlias(true);
    paintName.setTextSize(56);
    paintName.setColor(colors.parseColor('#ffffff'));
    let sub = userName.substring(0, userName.length - 1);
    let asterisk = '';
    for (let i = 0; i < sub.length; i++) {
        asterisk += '*';
    }
    let nameDisplay = userName.replace(sub, asterisk);
    canvas.drawText(nameDisplay, 54, 350, paintName);
    let paintId = new Paint();
    paintId.setAntiAlias(true);
    paintId.setTextSize(56);
    paintId.setColor(colors.parseColor('#ffffff'));
    let subId = userId.substring(0, 14);
    let asteriskId = '';
    for (let i = 0; i < subId.length; i++) {
        asteriskId += '*';
    }
    let idDisplay = userId.replace(subId, asteriskId);
    canvas.drawText(idDisplay, 54, 462, paintId);
    let paintTime = new Paint();
    paintTime.setAntiAlias(true);
    paintTime.setTextSize(40);
    let dt = new Date();
    canvas.drawText(dt.getFullYear().toString() + '年' + getFullNum(dt.getMonth() + 1) + '月' + getFullNum(dt.getDate()) + '日 ' + getFullNum(dt.getHours()) + ':' + getFullNum(dt.getMinutes()) + ':', 302, 811, paintTime);
    let paintTime2 = new Paint();
    paintTime2.setAntiAlias(true);
    paintTime2.setTextSize(50);
    paintTime2.setTypeface(Typeface.DEFAULT_BOLD);
    canvas.drawText(getFullNum(dt.getSeconds()), 722, 811, paintTime2);
    let savePath = files.getSdcardPath() + '/AutoFillIn2/';
    files.ensureDir(savePath);
    let final = canvas.toImage();
    images.save(final, savePath + 'pic.jpg');
    media.scanFile(savePath + 'pic.jpg');
    toastInfo('密接自查图片已保存。');
    final.recycle();
    picBlank.recycle();
    launch('com.tencent.mm');
    waitForPackage('com.tencent.mm');
    let groupName = text(userGroupName).findOne(5000);
    if (groupName) {
        groupName.parent().parent().parent().parent().parent().click();
        let more = descStartsWith('更多功能按钮').findOne(5000);
        if (more) {
            more.click();
            let gallery = text('相册').findOne(5000);
            if (gallery) {
                gallery.parent().parent().parent().clickCenter();
                let check = checkable(true).findOne(5000);
                if (check) {
                    check.click();
                    let send = textStartsWith('发送').findOne(5000);
                    if (send) {
                        send.click();
                        toastInfo('已发送。');
                    }
                    else {
                        toastError('未找到“发送”按钮。');
                        app.startActivity('console');
                    }
                }
                else {
                    toastError('未找到单选框。');
                    app.startActivity('console');
                }
            }
            else {
                toastError('未找到“相册”按钮。');
                app.startActivity('console');
            }
        }
        else {
            toastError('未找到“更多功能”按钮。');
            app.startActivity('console');
        }
    }
    else {
        toastError('未找到“' + userGroupName + '”。');
        app.startActivity('console');
    }
    device.cancelKeepingAwake();
    complete = true;
    running = false;
}
